import React from 'react';
import Navbar from '../navbar/navbar';
import Layout from '../layout/layout'


class Home extends React.Component {
    constructor(){
        super();
        this.state = {

        }

    }



  render() {
      console.log('Login state', this.state);
    return (
        <Layout>
            <Navbar />
            <div class="container">
              <h3>Profile Page</h3>
              <div>
              <img src={this.props.photo} alt="fail to load" />
              </div>
              <p>{this.props.userData.username}</p>
              <p>{this.props.userData.photo}</p>
              <p>{this.props.userData.food}</p>
              <p>{this.props.userData.gender}</p>
              <p>{this.props.userData.age}</p>
            </div>
        </Layout>
    );
  }
}

export default Home;
